import React from "react";
import { MdDesktopMac } from "react-icons/md";
import PText from "./PText";

const ItemStyles = styled.div`
  text-align: center .servicesItem__icon {
    svg {
      width: 3rem;
    }
  }
`;
export default function ServicesSectionItem() {
  return (
    <ItemStyles>
      <div className="servicesItem__icon">
        <MdDesktopMac> </MdDesktopMac>
        <div className="servicesItem__title">
          Web Design
          <PText>
            I am 21 year old, upcoming freelance web developer. Currently, I am
            a junior computer science major at Clemson University. I love to
            design and make new web applications for my clients.{" "}
          </PText>
        </div>
      </div>
    </ItemStyles>
  );
}
